package com.bamzy;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

/**
 * 438. Find All Anagrams in a String
 * Medium
 * Given two strings s and p, return an array of all the start indices of p's anagrams in s.
 * You may return the answer in any order.
 *
 * An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase,
 * typically using all the original letters exactly once.
 *
 *
 *
 * Example 1:
 * Input: s = "cbaebabacd", p = "abc"
 * Output: [0,6]
 * Explanation:
 * The substring with start index = 0 is "cba", which is an anagram of "abc".
 * The substring with start index = 6 is "bac", which is an anagram of "abc".
 *
 * Example 2:
 * Input: s = "abab", p = "ab"
 * Output: [0,1,2]
 * Explanation:
 * The substring with start index = 0 is "ab", which is an anagram of "ab".
 * The substring with start index = 1 is "ba", which is an anagram of "ab".
 * The substring with start index = 2 is "ab", which is an anagram of "ab".
 *
 */
public class FindAllStringAnagrams {
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();
        if(p.length()>s.length()) return result;

        HashMap<Character,Integer> map = new HashMap<>();
        HashMap<Character,Integer> second = buildMap(p,0,p.length());
        if(s.length()==p.length() && compare(second,buildMap(s,0,s.length()))) {result.add(0);return result;}
        boolean firstRound = true;
        for(int i=0;i<=s.length()-p.length();i++){
            if(firstRound){
                map = buildMap(s,0,p.length());
                firstRound = false;
            } else {
                map.put(s.charAt(i-1),map.get(s.charAt(i-1))-1);
                if(map.get(s.charAt(i-1))==0) map.remove(s.charAt(i-1));
                char nextChar = s.charAt(i + p.length()-1);
                if(!map.containsKey(nextChar)) map.put(nextChar,1);
                else map.put(nextChar,map.get(nextChar)+1);
            }
            if (compare(map,second)) result.add(i);
        }
        return result;
    }
    private HashMap<Character, Integer> buildMap(String s,int start,int end){
        HashMap<Character, Integer> map = new HashMap<>();
        for(int j=start;j<end;j++){
            if(!map.containsKey(s.charAt(j))) map.put(s.charAt(j),1);
            else map.put(s.charAt(j),map.get(s.charAt(j))+1);
        }
        return map;
    }
    private boolean compare(HashMap<Character, Integer> src, HashMap<Character, Integer> dest){
        if(dest.size()!=src.size()) return false;
        for (Character key: src.keySet()){
            if(!dest.containsKey(key)) return false;
            if((int)dest.get(key) != (int)src.get(key)) return false;
        }
        return true;
    }

    public static void runTest(){
        FindAllStringAnagrams fasa = new FindAllStringAnagrams();
        List<Integer> tmp = fasa.findAnagrams("cbaebabacd", "abc");
        List<Integer> tmp1 = fasa.findAnagrams("abab", "ab");
        List<Integer> tmp2 = fasa.findAnagrams("baa", "aa");
        List<Integer> tmp3 = fasa.findAnagrams(""
                                             , "");
    }
}
